  return (
    <div className="text-center mt-5">
      <h1>OOPS!</h1>
      <h2>404 — Risorsa non trovata!</h2>
      <p className="lead">
        L'informazione che stavi cercando non è disponibile.{" "}
        <Link to="/">Torna alla home</Link>
      </p>

      <Link to="/" className="btn btn-primary">
        Torna alla home
      </Link>
    </div>
  );
};

export default NotFound;
